INSERT INTO `data_api_program` VALUES (2,'2015-09-18 16:37:53','2015-09-18 16:38:20','8ebce81f-2843-4ca1-a8b5-e7577baf154d','import time\nfrom data_connection import *\nfrom base import *\nimport datetime\nimport pytz\n\n# create data connection\nconfigurator = init_configurator()\ndata_connection = DataConnection(configurator)\n\nsignal=data_connection.get_or_create_signal(\"test_signal_saw_2\")\n\nt = datetime.datetime.now(tz=pytz.UTC)\nprint \"got datetime {}\".format(t)\n\ntvec = [t + datetime.timedelta(seconds=i*.01) for i in range(10)]\ntsvec = [DataConnection.utc_to_millisec(at) for at in tvec]\n\n# create a sawtooth wave\nsignal_vector =  [[ats-tsvec[0], ats] for ats in tsvec]\n\ndata_connection.add_signal_points(signal[\'id\'], signal_vector)','another load test','write data 2',1),(3,'2015-09-18 16:39:08','2015-09-18 16:39:33','b2636dbb-cbaf-4ec9-a99d-62ae8819be7a','import time\nfrom data_connection import *\nfrom base import *\nimport datetime\nimport pytz\n\n# create data connection\nconfigurator = init_configurator()\ndata_connection = DataConnection(configurator)\n\nsignal=data_connection.get_or_create_signal(\"test_signal_saw_3\")\n\nt = datetime.datetime.now(tz=pytz.UTC)\nprint \"got datetime {}\".format(t)\n\ntvec = [t + datetime.timedelta(seconds=i*.01) for i in range(10)]\ntsvec = [DataConnection.utc_to_millisec(at) for at in tvec]\n\n# create a sawtooth wave\nsignal_vector =  [[ats-tsvec[0], ats] for ats in tsvec]\n\ndata_connection.add_signal_points(signal[\'id\'], signal_vector)','','write_data_4',1),(4,'2015-09-18 16:40:03','2015-09-18 16:40:33','8787c116-3ea2-4c21-95d5-abb5181127a2','import time\nfrom data_connection import *\nfrom base import *\nimport datetime\nimport pytz\n\n# create data connection\nconfigurator = init_configurator()\ndata_connection = DataConnection(configurator)\n\nsignal=data_connection.get_or_create_signal(\"test_signal_saw_4\")\n\nt = datetime.datetime.now(tz=pytz.UTC)\nprint \"got datetime {}\".format(t)\n\ntvec = [t + datetime.timedelta(seconds=i*.01) for i in range(10)]\ntsvec = [DataConnection.utc_to_millisec(at) for at in tvec]\n\n# create a sawtooth wave\nsignal_vector =  [[ats-tsvec[0], ats] for ats in tsvec]\n\ndata_connection.add_signal_points(signal[\'id\'], signal_vector)','','write_data_3',1),(5,'2015-11-26 00:04:11','2015-11-26 00:04:34','8f8a8920-b693-421a-976b-774abe0b1656','print \"hello\"','print hello every 1 second','print hello',1),(6,'2015-11-26 01:31:40','2016-04-01 14:55:06','8e689fed-1aa2-4850-b9d0-bf4be0a12f94','import time\nfrom data_connection import *\nfrom base import *\nimport datetime\nimport pytz\nfrom subprocess import call\n\n\nconfigurator = init_configurator(\"config.json\")\ndata_connection = DataConnection(configurator)\n\ncall([\"raspistill\", \"-o\", \"out.jpeg\"])\nwith open(\"out.jpeg\", \"r\") as output:\n    data = output.read()\n    blob = data_connection.get_or_create_blob(\"current10.jpeg\", \"image/jpeg\")\n    data_connection.set_blob_data(blob[\'id\'], data)\n    print \"saved data\"','Take a snapshot and save every 10s','pi snapshots',10),(7,'2015-11-29 20:23:41','2016-03-25 13:46:25','3d13b6a7-e3c4-4867-b17c-1f1e2478a1c6','from BrickPi import *\nimport time\nBrickPiSetup()\nBrickPi.MotorEnable[PORT_B] = 1 #Enable the Motor A\nBrickPi.MotorEnable[PORT_D] = 1 #Enable the Motor B\n    \nBrickPi.SensorType[PORT_2] = TYPE_SENSOR_EV3_US_M0   	#Set the type of sensor at PORT_4.  M0 is continuous measurement in cm. \nBrickPiSetupSensors()   	\nBrickPiUpdateValues() \n\ndef get_ultrasonic():\n    result = BrickPiUpdateValues()     \n    return BrickPi.Sensor[PORT_2]\n    \ndef turn_left():\n    BrickPi.MotorSpeed[PORT_B] = 100  #Set the speed of MotorA (-255 to 255)\n    BrickPi.MotorSpeed[PORT_D] = -100  #Set the speed of MotorA (-255 to 255)\n    \n    ot = time.time()\n    while(time.time() - ot < .3):    #running while loop for 3 seconds\n        BrickPiUpdateValues()\n        time.sleep(.1)\n    BrickPi.MotorSpeed[PORT_B] = 0  #Set the speed of MotorA (-255 to 255)\n    BrickPi.MotorSpeed[PORT_D] = 0  #Set the speed of MotorA (-255 to 255)\n    BrickPiUpdateValues()    \n     \ndef move_forward():\n    BrickPi.MotorSpeed[PORT_B] = 200  #Set the speed of MotorA (-255 to 255)\n    BrickPi.MotorSpeed[PORT_D] = 200  #Set the speed of MotorA (-255 to 255)\n    \n    ot = time.time()\n    while(time.time() - ot < .5):    #running while loop for 3 seconds\n        BrickPiUpdateValues()\n        time.sleep(.1)\n    \n    BrickPi.MotorSpeed[PORT_B] = 0  #Set the speed of MotorA (-255 to 255)\n    BrickPi.MotorSpeed[PORT_D] = 0  #Set the speed of MotorA (-255 to 255)\n    	\n    BrickPiUpdateValues()    \n\nfor i in range(1,20):\n    range = get_ultrasonic()\n    print \"range \" + range\n    if range > 1:\n        move_forward()\n    else:\n        turn_left()','brickpi - move forward and then stop','move forward and stop',10),(8,'2015-12-31 23:57:16','2016-08-12 05:11:23','3061e7c7-1508-46ad-a6f1-4251bdc57ad6','','','new program',1),(9,'2016-02-05 04:28:21','2016-02-05 04:28:21','c5235fb4-918f-414c-a602-665378ed9811','',NULL,'new program',1),(10,'2016-03-23 22:53:23','2016-03-23 22:53:23','ae355ded-2e11-409c-aefe-9b1abb979edc','',NULL,'new program',1),(11,'2017-03-27 22:30:15','2017-03-27 22:30:15','5a1d8c63-fdac-4c0f-a7ec-4cadf2a63413','',NULL,'new program',1),(12,'2017-03-27 22:30:16','2017-03-27 22:30:16','f8968d4c-6385-4d9e-8e99-995588a7a773','',NULL,'new program',1),(13,'2017-05-16 15:21:44','2017-05-16 15:21:44','91f58fd2-379f-4e14-b7ee-df5327675fb1','',NULL,'new program',1);
